import React from "react";
import ReactDOM from "react-dom";
import App from "components/App";
// import fbase from "fbase";
// console.log(fbase);
import "./styles.css";

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
